@use "../abstracts" as *;

@import url("https://cdn.jsdelivr.net/npm/bootstrap-icons@1.7.2/font/bootstrap-icons.css");

@import url("https://fonts.googleapis.com/css2?family=Roboto:wght@300;400;700;900&display=swap");

@font-face {
  font-family: gilroy;
  src: url(../fonts/Gilroy-ExtraBold.otf);
  font-weight: bold;
}

@font-face {
  font-family: gilroy;
  src: url(../fonts/Gilroy-Light.otf);
  font-weight: normal;
}

* {
  line-height: 1.5em;
  color: $text-colour;
}

h1 {
  font-family: gilroy;
  font-weight: bold;
  font-size: 2.2rem;
  line-height: 1.2em;
}

h2 {
  @include h2;
}

h3 {
  font-family: gilroy;
  font-weight: bold;
  font-size: 1.2rem;
  line-height: 1.2em;
}

p {
  font-family: "Roboto", sans-serif;
  font-weight: 400;
  font-size: 1rem;
  line-height: 1.5em;
}

