sources.scss/components/_header.scss:
@use "../abstracts" as *;

.header {
  // height: 3.5rem;
  background-color: $main;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  position: relative;

  &__logo {
    // max-width: 100%;
    height: 2.5rem;
    margin: 0.5rem 0;
  }

  &__user {
    position: absolute;
    font-size: 1.8rem;
    right: 1.4rem;
    top: 0.9rem;
    font-size: 1.8rem;
    transition-duration: 0.2s;
  }

  &__user:hover {
    color: $highlight-1;
  }
}

.activeUser {
  color: $highlight-1;
}

.navbar {
  a {
    text-decoration: none;
  }

  &__list {
    display: flex;
    list-style: none;
  }

  &__link {
    // color: $secondary;
    color: #ffffff;
    font-family: gilroy;
    font-weight: bold;
    font-size: 1rem;
    line-height: 1.2em;
    margin: 0.5rem;
    margin-bottom: 1rem;
    opacity: 50%;
    position: relative;
    letter-spacing: 1px;
    cursor: pointer;
  }

  &__link:hover {
    color: #ffffff;
    opacity: 100%;
    transition: 0.2s;
    transition-timing-function: linear;
  }

  &__link--active {
    color: #ffffff;
    opacity: 100%;
  }

  &__link--active:after {
    content: "";
    position: absolute;
    width: 100%;
    height: 5px;
    background: $highlight-1;
    position: absolute;
    bottom: -1rem;
    left: 0;
  }
}

