.project-page-container {
  position: absolute;
  overflow: auto;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 80%;
  max-width: 1600px;
  max-height: 80%;
  background-color: $secondary;
  padding: 3rem;
  border-radius: 10px;
  z-index: 1;
