sources.scss/components/_pagination.scss:
@use "../abstracts" as *;

.pagination {
  display: flex;
  justify-content: center;
  align-items: center;
  height: 160px;

  ul {
    display: flex;
    background-color: $secondary;
    padding: 0.5rem;
    border-radius: 50px;
  }

  ul li {
    list-style: none;
    text-align: center;
    font-size: 1rem;
    font-family: "Roboto", sans-serif;
    font-weight: 400;
    line-height: 40px;
    cursor: pointer;
    transition: all 0.2s ease;
  }

  &__dots {
    font-family: "Roboto", sans-serif;
    font-weight: 400;
    cursor: default;
    width: 12px;
  }

  &__number {
    height: 40px;
    width: 40px;
    border-radius: 50%;
    margin: 0 3px;
  }

  &__prev,
  &__next {
    width: 36px;
  }

  &__prev {
    border-radius: 20px 2px 2px 20px;
  }

  &__next {
    border-radius: 2px 20px 20px 2px;
  }

  ul li.active,
  &__number:hover,
  &__prev:hover,
  &__next:hover {
    background: white;
  }
}

sources.scss/components/_projects.scss:
@use "../abstracts" as *;

.projects-container {
  height: auto;
  display: flex;
  justify-content: center;
  margin-bottom: 3rem;
  padding: 1rem;
}

.projects {
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  gap: 1rem;
}

.project-card-container {
  display: flex;
  flex-direction: column;
  align-items: center;
  background-color: $secondary;
  height: 26.5rem;
  width: 21rem;
  border-radius: 10px;
  list-style: none;
}

.project-card {
  &__img {
    max-width: 100%;
    height: 21rem;
    border-radius: 10px 10px 0 0;
    object-fit: cover;
  }

  &__text-container {
    display: flex;
    align-items: center;
    justify-content: space-between;
    margin-top: 0.4rem;
    width: 85%;
  }

  &__id {
  }

  &__title {
    margin-top: 1rem;
  }

  &__eta {
    font-size: 1rem;
  }

  &__heart {
    margin-top: 0.7rem;
    font-size: 1.7rem;
    transition-duration: 0.2s;
  }

  &__heart:hover {
    color: $highlight-1;
  }
}

