sources.scss/components/_request-modal.scss:
@use "../abstracts" as *;

.modal-overlay {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background-color: #000000;
  opacity: 0.6;
}

.request-modal-container {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  background-color: $secondary;
  border-radius: 10px;
  padding: 1rem;
  width: 90%;
  max-width: 500px;
}

input:nth-of-type(1) {
  margin-top: 1.5rem;
}

.request-modal {
  input,
  textarea {
    width: 100%;
    max-width: 100%;
    min-width: 100%;
    margin-bottom: 1rem;
    font-family: "Roboto", sans-serif;
    font-weight: 400;
    font-size: 1em;
    line-height: 1.5em;
    border: none;
    border-radius: 8px;
    padding: 8px;
  }

  &__button-container {
    display: flex;
    justify-content: center;
  }

  &__button {
    padding: 4px 16px;
    font-family: "Roboto", sans-serif;
    font-weight: bold;
    font-size: 1em;
    color: $main;
    border-radius: 4px;
    border: 2px solid $main;
    background-color: $secondary;
    cursor: pointer;
    text-align: center;
  }

  &__button:hover {
    background-color: $main;
    color: $secondary;
  }
}

sources.scss/components/_search-bar.scss:
@use "../abstracts" as *;

.search-bar {
  height: 6rem;
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: white;

  &__input {
    width: 100%;
    max-width: 100%;
    border: 3px solid $secondary;
    text-align: center;
    padding: 0.8rem 0;
    border-radius: 1.8rem;
    color: $text-colour;
    max-width: 600px;
    @include h2;
  }
}

// Fixed - JS activated
.search_bar--fixed {
  position: fixed;
  top: 0;
  width: 100%;
  border-bottom: 1px solid #1a4f4f4f;
}
